import React from 'react';
import '../styling/language-focus.css';

const LanguageFocus = ({ language, languageRatio, repos }) => {
    return (
        <div className='lang-container'>
            <div className='header'>
                <h1>{language}</h1>
                <div className='ratio-container'>
                    <div className='ratio'>
                        <h1>{languageRatio}</h1><h4>%</h4>
                    </div>
                </div>
            </div>
            <div className='lang-body'>

            </div>
            <div className='repos'>
                <div className='repo'>
                    <div className='top-repo'>

                    </div>
                {repos && repos.length > 0 ? (
                    repos.map((repo, index) => (
                        <div key={index} className='repo-item'>
                            <h3>{repo ? repo.name : 'No Name'}</h3>
                            <p>{repo ? repo.description : 'No Description'}</p>
                            {/* ... */}
                        </div>
                    ))
                ) : (
                    <p>No repositories to display.</p>
                )}
                </div>
            </div>
        </div>
    );
};

export default LanguageFocus;
